# Remove consecutive repetitions of characters from the string
def remove_repetitions(s):
    result = [s[0]]  # Initialize result with the first character of the input string
    for char in s[1:]:  # Start from the second character
        if char != result[-1]:  # If current character is different from the last one in result
            result.append(char)  # Add it to the result
    return ''.join(result)  # Convert the list back to a string

# Assuming input_string is your string
input_string = ""  # Keep input string here
cleaned_string = remove_repetitions(input_string)

print(cleaned_string)
